import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes";

let createNote = (list) => {
    <Note 
        key={list.key}
        title={list.tile}
        content={list.content}
    />
}


let App = () => {
   (
        <div>
            <Header />
            {notes.map(createNote)}
            <Footer />
        </div>
    );
}

export default App;
